import showerImg from '../asset/iconBar/shower.png';
import hungerImg from '../asset/iconBar/hunger.png';
import bedImg from '../asset/iconBar/bed.png';
import happyImg from '../asset/iconBar/happy.png';
import healthImg from '../asset/iconBar/health.png';

const Status = ({ bath, hunger, sleep, happiness, health }) => {
    return (
        <>
            <progress value={bath} id="bath" max="100"></progress>
            <progress value={hunger} id="hunger" max="100"></progress>
            <progress value={sleep} id="sleeps" max="100"></progress>
            <progress value={happiness} id="happy" max="100"></progress>
            <progress value={health} id="health" max="100"></progress>
            <div><img src={showerImg} className="bath-picture" alt="Shower" /></div>
            <div><img src={hungerImg} className="hunger-picture" alt="Hunger" /></div>
            <div><img src={bedImg} className="sleeps-picture" alt="Bed" /></div>
            <div><img src={happyImg} className="happy-picture" alt="Happy" /></div>
            <div><img src={healthImg} className="health-picture" alt="Health" /></div>
        </>
    )
}

export default Status;
